import { Header } from "./Header"
const { editor } = window.data

export const EditorWindow = ({ text, content, position }) => {
  return <div
    style={{
      backgroundColor: "black",
      gridRow: `1 / span 2`,
      gridColumn: `${position.y} / span 1`
    }}
    onClick={() => {
      editor.selectedField = `inspector`
    }}
  >
    <Header
      text={text}
    />
    {content}
  </div>
}
